import { useContext, useState } from "react"
import "./LogsWindow.css"
import React from "react"
import { SingleLog, LogListContainer } from "./LogWindow.style"
import { FocusedLogIndexContext } from "../FocusedLogIndexContext"


type Logs = {
    logList:string[],
    handleLogList: (arg:string[])=>void
    focusedLogIndex: number
}

export const LogsWindow = (props:Logs)=>{

    const [clickedLog, setClickedLog] = useState<string>("")
    const {focusedLogIndex, setFocusedLogIndex} = useContext(FocusedLogIndexContext)

    return (
        <>

            <LogListContainer>
                {props.logList?props.logList.map((log,index)=><SingleLog focusedLog={index==props.focusedLogIndex}  onClick={()=>{setClickedLog(log)}}>{log}</SingleLog>):""}
            </LogListContainer>


        </>
    )

}
